ua = UserAgent()


# 代理ip线程池
def get_proxy():
    return requests.get("http://127.0.0.1:5010/get/").json()


def delete_proxy(proxy):
    requests.get("http://127.0.0.1:5010/delete/?proxy={}".format(proxy))


# 爬虫相关
def get_html(url):
    USER_AGENT = ua.random
    headers = {
        "User-Agent": USER_AGENT,
        "Connection": "keep-alive",
        "Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng,*/*;q=0.8",
        "Accept-Language": "zh-CN,zh;q=0.8"}

    retry_count = 5  # 容错次数
    proxy = get_proxy().get("proxy")  # 获取代理ip
    print("代理ip为：" + str(proxy))
    print("User-agent：" + USER_AGENT)
    while retry_count > 0:
        try:
            resp = requests.get(url, headers=headers, proxies={"http": "http://{}".format(proxy)})
            resp.encoding = 'utf-8'
            html = resp.text
            return html
        except Exception:
            retry_count -= 1
    # 出错5次, 删除代理池中代理
    delete_proxy(proxy)
    return None  # 如果请求失败则返回None


def parse_img(text):
    data_3d_list = re.findall(r'VRHOUSE_DATA_3D = (.+?)    </script>', text)
    if not data_3d_list:
        data_3d_list = re.findall(r'\(\'vrdataload\',(.+?)\)', text)
    data_3d = data_3d_list[0]
    data = json.loads(data_3d)
    hotspots = data['HotSpots'][0]['TileImagesPath']
    print(hotspots)
    return hotspots


